      out.write("							<ul>\r\n");
      out.write("								<li><p><font color=\"#ff0000\"><span style=\"font-size: 11pt;\"><b>★홈플러스 무료주차 4시간 가능, 차량 등록은 구장에 비치되어 있는 테블릿PC에 직접 입력하셔야 됩니다.(미입력으로 인한 주차비는 구장에서 책임지지 않음)★</b></span></font></p><p><b style=\"color: rgb(58, 50, 195); font-size: 12pt;\">☆코로나19 여파로 대관에 신중을 기해주시기 바랍니다.(환불 규정에 따라 환불, 연기 불가)☆</b></p><p><span style=\"font-size: 11pt; color: rgb(255, 0, 0);\"><b>1. 예약신청 후 2시간 내에 입금되지 않을 시 자동취소 됩니다.</b></span></p><p><span style=\"font-size: 11pt;\">* 예약자와 입금자 이름이 다를 경우 반드시 전화주세요.</span></p><p><span style=\"font-size: 11pt;\">- 입금 계좌 : 경남은행 010-9423-0885 [예금주: 임세혁(하이파이브)]</span></p><p><span style=\"font-size: 11pt;\">2. 문의 전화 : 055-267-0800 / 010-9423-0885 (통화가능시간 : 14:00 ~ 22:00)</span></p><p><span style=\"font-size: 11pt; color: rgb(255, 0, 0);\"><b>3. 전 구역 금연지역입니다.</b></span></p><p><span style=\"font-size: 11pt; color: rgb(255, 0, 0);\"><b>(흡연은 흡연실을 이용해 주세요, 경기장내 흡연 적발 시 대관 취소 및 환불 불가)</b></span></p><p><span style=\"font-size: 11pt;\">4. 경기장 내 음료 및 음식물 반입 금지(코로나19로 인해 물, 음료 이외 취식 불가)</span></p><p><span style=\"font-size: 11pt;\">5. 주차는 경기장 앞 7층 주차장을 이용하시기 바랍니다.(4시간 무료 주차 직접 등록)</span></p><p><span style=\"font-size: 11pt;\">6. 본 풋살파크는 CCTV 촬영되고 있습니다.</span></p><p><span style=\"font-size: 11pt;\">7. 개인장비는 직접 지참하시기 바랍니다.(풋살화 등)</span></p><p><span style=\"font-size: 11pt;\">8. 풋살화 미착용시 구장이용이 제한됩니다.(부상위험 및 잔디보호)</span></p><p><span style=\"font-size: 11pt;\">9. 야간 대관 이용 시 소음 관련 민원이 자주 발생하오니 고성, 욕설 등 삼가해 주시기 바랍니다.</span></p><p><span style=\"font-size: 11pt; color: rgb(255, 0, 0);\"><b>10. 경기장 이용시 발생하는 부상 및 상해, 개인 자산의 손괴 및 분실 등에 대한 책임은 본인에게 있습니다.(개인 및 팀은 의료 실비 보험 필수 가입)</b></span></p></li>\r\n");
