      out.write("});\r\n");
      out.write("\r\n");
      out.write("function addCommas(str){\r\n");
      out.write("	str = \"\"+str+\"\";\r\n");
      out.write("	var retValue = \"\";\r\n");
      out.write("	for(i=0; i<str.length; i++){\r\n");
      out.write("		if(i > 0 && (i%3)==0) {\r\n");
      out.write("			retValue = str.charAt(str.length - i -1) + \",\" + retValue;\r\n");
      out.write("		}\r\n");
      out.write("		else {\r\n");
      out.write("			retValue = str.charAt(str.length - i -1) + retValue;\r\n");
      out.write("		}\r\n");
      out.write("	}\r\n");
      out.write("	return retValue;\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function delCommas(str){\r\n");
      out.write("	str = \"\"+str+\"\";\r\n");
      out.write("	var retValue = \"\";\r\n");
      out.write("	retValue = str.replace(\",\",\"\");\r\n");
      out.write("	retValue = retValue.replace(\",\",\"\"); \r\n");
      out.write("	return retValue;\r\n");
      out.write("}\r\n");
      out.write("\r\n");
