      out.write("		$(\"#calendarDiv\").html(r);\r\n");
      out.write("	});\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function getCalendarByStadium(e){\r\n");
      out.write("	var stadium_code = e.value;\r\n");
      out.write("	var v; \r\n");
      out.write("	v = $(\"#regdate\").text();\r\n");
      out.write("	v = v.replace(\".\",\"-\");\r\n");
      out.write("	v = v.replace(\".\",\"-\"); \r\n");
      out.write(" \r\n");
      out.write("	$.get(\"ajax_calendar.asp?stadium_code=\"+stadium_code+\"&reqdate=\"+v , function(r){ \r\n");
      out.write("		$(\"#calendarDiv\").html(r);\r\n");
      out.write("	});\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function getTime(){\r\n");
      out.write("	var reqdate = document.form.reg_date.value;\r\n");
      out.write("	var stadium_code = document.form.stadium_code.value;\r\n");
      out.write("	//window.open(\"ajax_time.asp?reqdate=\"+reqdate+\"&stadium_code=\"+stadium_code );\r\n");
      out.write("	$.get(\"ajax_time.asp?reqdate=\"+reqdate+\"&stadium_code=\"+stadium_code+\"&branch_code=HM0009\", function(r){ \r\n");
      out.write("		$(\"#timeDiv\").html(r);\r\n");
      out.write("		calc();\r\n");
      out.write("	}); \r\n");
      out.write("} \r\n");
      out.write("\r\n");
      out.write("function showStadiumName(e){\r\n");
      out.write("	$(\"#stadiumBottom\").text($(e).find(\"option[value='\" + $(e).val() + \"']\").text());\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function chgDate(e, v){\r\n");
      out.write("	var nv = v.replace(\"-\",\".\");\r\n");
      out.write("	nv = nv.replace(\"-\",\".\");\r\n");
      out.write("	$(\"#regdate\").text(nv);\r\n");
