      out.write("	document.form.reg_date.value=v;\r\n");
      out.write("	getTime(); \r\n");
      out.write("	$(\".buts\").removeClass(\"on\");\r\n");
      out.write("	$(e).parent().children(\".buts\").addClass(\"on\");\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function setTime(e){ \r\n");
      out.write("	if ($(e).parent().children(\".r_time_no_check\").prop(\"checked\"))\r\n");
      out.write("	{\r\n");
      out.write("		$(e).removeClass(\"on\");\r\n");
      out.write("		$(e).parent().children(\".r_time_no_check\").prop(\"checked\",false);\r\n");
      out.write("	}else{\r\n");
      out.write("		$(e).addClass(\"on\");\r\n");
      out.write("		$(e).parent().children(\".r_time_no_check\").prop(\"checked\",true);\r\n");
      out.write("\r\n");
      out.write("	}\r\n");
      out.write("	calc();\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function calc(){\r\n");
      out.write("	var rent_price = 0 ;\r\n");
      out.write("	var rent_count = 0 ;\r\n");
      out.write("	var shour\r\n");
      out.write("	var timestr = \"\";\r\n");
      out.write("	var optstr = \"\";\r\n");
      out.write("\r\n");
      out.write("	$(\".r_time_no_check:checkbox:checked\").each(function(){\r\n");
      out.write("		rent_price = rent_price + parseInt($(this).attr(\"alt\"));\r\n");
      out.write("\r\n");
      out.write("		var t = $(this).val().split(\"|\");\r\n");
      out.write("		var stime = t[1];\r\n");
      out.write("		var etime = t[2];\r\n");
      out.write("		timestr = timestr + stime + \"~\" + etime + \"<BR>\";\r\n");
      out.write("\r\n");
      out.write("		rent_count ++;\r\n");
      out.write("	});\r\n");
      out.write("\r\n");
      out.write("	var option_price = 0 ;\r\n");
      out.write("	$(\".opt_total\").each(function(){\r\n");
      out.write("		option_price = option_price + parseInt($(this).val()); \r\n");
      out.write("	});\r\n");
      out.write("	\r\n");
      out.write("	$(\".opt_cnt\").each(function(){\r\n");
      out.write("		if (parseInt($(this).val())>0)\r\n");
      out.write("		{\r\n");
      out.write("			optstr = optstr + $(this).parent().children(\".opt_name\").val() + \" : \" + $(this).val() + \"<BR>\"; \r\n");
      out.write("		}\r\n");
      out.write("	});\r\n");
      out.write("\r\n");
      out.write("	var total_price = rent_price + option_price;\r\n");
      out.write("\r\n");
      out.write("	$(\"#rentPriceView\").text(addCommas(rent_price));\r\n");
      out.write("	$(\"#rentCountView\").text(addCommas(rent_count));\r\n");
      out.write("	$(\"#optionPriceView\").text(addCommas(option_price)); \r\n");
      out.write("	$(\"#totalPriceView\").text(addCommas(total_price));\r\n");
      out.write("\r\n");
      out.write("	$(\"#priceBottom\").text(addCommas(total_price));\r\n");
      out.write("	$(\"#timeBottom\").html(timestr);\r\n");
      out.write("	$(\"#optionBottom\").html(optstr);\r\n");
      out.write("	document.form.total_price.value=total_price;\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function selOpt1(e){\r\n");
      out.write("	var c;\r\n");
      out.write("	var opts = e.value;  \r\n");
      out.write("	var optArr = opts.split(\"||\");\r\n");
      out.write("	$(e).parent().parent().children(\".opt_idx\").val(optArr[0]); \r\n");
      out.write("	$(e).parent().parent().children(\".opt_price\").val(optArr[1]);  \r\n");
      out.write("	$(e).parent().parent().children(\".opt_name\").val(optArr[2]);  \r\n");
      out.write("	var price = parseInt(optArr[1]); \r\n");
      out.write("\r\n");
      out.write("	var cnt = parseInt($(e).parent().parent().children(\".opt_c\").val()); \r\n");
      out.write("	$(e).parent().parent().children(\".price\").children(\".priceView\").text(addCommas(price*cnt)); \r\n");
      out.write("	$(e).parent().parent().children(\".opt_total\").val(price*cnt);  \r\n");
