      out.write("	c = e.text();\r\n");
      out.write("	$(e).parent().parent().find(\"label\").text(c);\r\n");
      out.write("\r\n");
      out.write("	calc();\r\n");
      out.write("}\r\n");
      out.write("function selOpt2(e){\r\n");
      out.write("	var cnt = parseInt(e.value);  \r\n");
      out.write("	$(e).parent().children(\".opt_cnt\").val(cnt);  \r\n");
      out.write("\r\n");
