      out.write("function cloneOpt(e, v){  \r\n");
      out.write("	var a,b;\r\n");
      out.write("\r\n");
      out.write("	a=$(\".opt_list\").length;\r\n");
      out.write("	a++;\r\n");
      out.write("\r\n");
      out.write("	var clon = $(e).parent().parent().parent().clone();\r\n");
      out.write("\r\n");
      out.write("	clon.find(\"label\").attr(\"for\",\"opt\"+a);\r\n");
      out.write("	clon.find(\"select\").attr(\"id\",\"opt\"+a);\r\n");
      out.write("\r\n");
      out.write(" 	clon.find(\".opt_idx\").val(\"\");\r\n");
      out.write("	clon.find(\".opt_name\").val(\"\");\r\n");
