      out.write("	clon.find(\".opt_cnt\").val(\"0\");\r\n");
      out.write("	clon.find(\".opt_c\").val(\"0\"); \r\n");
      out.write("	clon.find(\".priceView\").text(\"0\"); \r\n");
      out.write("\r\n");
      out.write("	clon.attr('data-id', 1);\r\n");
      out.write("\r\n");
      out.write("	b = clon.find(\"select option:eq(0)\").text();\r\n");
      out.write("	clon.find(\"select option:eq(0)\").prop(\"selected\", true);\r\n");
      out.write("	clon.find(\"label\").text(b);\r\n");
      out.write("\r\n");
      out.write("	$(e).parent().parent().parent().parent().append(clon);  \r\n");
      out.write("}\r\n");
